- input: "TEXT\x1CC00462374\x1C.TEXT\x1C\x1CF3A\x1C1) The process by which the Crawford
    for Congress campaign collects required employer and occupation information is
    as follows:  When a contribution is received in person, the occupation and employer
    information is requested from the donating party.  If a donation is received unsolicited
    via mail, the occupation and employer information is requested via phone from
    the donor.  If the donation is received online, the employer and occupation information
    is required to complete the transaction.  If these efforts to obtain the information
    prove unsuccessful, an information request card (along with a pre-addressed return
    envelope) is mailed to donor within 30 days clearly asking for the missing information
    and informing the donor of the requirements of federal law for the reporting of
    such information.  If we are unable to collect the information, we populate each
    field with 'Information Requested' or 'Requested.'      2) The loan from the candidate
    has been extended until 4/19/11.  This extension was not officially in place until
    10/19/10, so the loan information contained in this report has not been updated.
    \ It will be updated on a subsequent report to reflect the new due date.                                                                                                               3)
    AR-01 Congressional Victory Committee--Only 2 of the donations related to this
    receipt were over the $200 itemization threshhold.  They have now been itemized.\n"
